import React from 'react';
import { AiFillSetting } from "react-icons/ai";
import { Menubar } from 'primereact/menubar';
import Branch from './components/Setting/Branch';
import Brand from './components/Setting/Brand';
import Category from './components/Setting/Category';
import Department from './components/Setting/Department';
import DeviceStatus from './components/Setting/DeviceStatus';


const links = [
    { label: 'Branch', href: '/Branch', icon: 'pi pi-fw pi-file', },
    { label: 'Brand', href: '/Brand' },
    { label: 'Category', href: '/Category' },
    { label: 'Department', href: '/Department' },
    { label: 'DeviceStatus', href: '/DeviceStatus' },
]


function Setting() {



    return (
        <div className='mx-auto max-w-7xl px-2 sm:px-6 lg:px-8 container mt-5 shadow-md rounded-lg py-5 mb-10 h-screen'>

            <div className="items-center">
                <span className='lg:text-3xl font-bold text-indigo-700 sm1:text-2xl py-2 items-center flex gap-2'>ตั้งค่า (Settings)
                    <AiFillSetting className="h-7 w-7" />
                </span>
            </div>
            <hr />
            {/* <div className="grid grid-cols-1 gap-x-8 gap-y-6 text-base font-semibold leading-7 text-white sm:grid-cols-2 md:flex lg:gap-x-10 bg-slate-400">
                {links.map((link) => (
                    <a key={link.name} href={link.href}>
                        {link.name} <span aria-hidden="true"></span>
                    </a>
                ))}
            </div> */}
            <Menubar model={links} class='text-lg text-indigo-700' />
            <Brand></Brand>
            <Branch />

        </div>
    )
}

export default Setting
